import "./Product.css";
import "./productlist.css"
import { useStateValue } from "./StateProvider";
import "./DeskTopHomepageLayout.css"
import DeskTopHomepageLayoutProduct from "./DeskTopHomepageLayoutProduct"
import React, { Component } from "react";
import axios from "axios";
import Product from "./Product";
import { endpoint } from "../constants";
import { NavLink } from 'react-router-dom'

class PhoneHomePageProductList1 extends Component {





    state = {
        loading: false,
        error: null,
        data: []
    };
    componentDidMount() {
        this.setState({ loading: true });



        axios
            .get(`${endpoint}/PhoneHomePageProductListSlider1ListView/`)



            .then(res => {
                this.setState({ data: res.data.results, loading: false });
                // console.log('phon data',data)




            })
            .catch(err => {
                this.setState({ error: err, loading: false });
            });
    }



    render() {
        const { data } = this.state


        return (
            <>

                {data &&
                    data.map(v => {
                        return (

                            <div className='col-4' style={{ padding: '1px', }}>
                                <NavLink to={v.link}>
                                    <img src={v.image} style={{borderRadius:'0px' ,padding:0}} class="img-thumbnail" alt="..."/>
                                </NavLink>
                            </div>



                        );

                    })}




            </>
        );
    }
}
export default PhoneHomePageProductList1;
